using AD2 = std::array<double, 2>;
std::vector<AD2> transform_polygon(std::vector<AD2> poly_pts, AD2 &origin) {
  for (auto &p : poly_pts) {
    p[0] -= origin[0];
    p[1] -= origin[1];
  }
  return poly_pts;
}

